import Vue from 'vue'
import VueRouter from 'vue-router'

//安装vueRouter插件，对vue功能的扩展
Vue.use(VueRouter)

export default new VueRouter({
	routes:[
		{
			name:"login",
			path:"/login",
			component: ()=> import("./components/Login.vue")
		},
		{
			name:"mainpage",
			path:"/mainpage",
			component: ()=> import("./components/Mainpage.vue"),
			children:[
				{
					name:"student",
					path:"/student",
					component: ()=> import("./components/student.vue")
				}
			]
		}
	]
});
